import styled from "styled-components";

export const StepNavDiv = styled.div`
    width:100%;
    height:3.5em;
    margin: 0;
    box-sizing:border-box;
    padding: 0em 1.5em;
    color:rgba(102,102,102,0.7);
   
    display:flex;
    flex-direction:row;
    align-items: center;
`;

export const OneThirdDiv = styled.div`
    flex:calc(1/3);
    display: flex;
    flex-direction: row;
    justify-content: center;

`;
